const images = [image1, image2, image3, image4, image5, image6, image7];

const ZoomParallax = () => {
  return (
    <div className="zoom-parallax-gallery">
      {images.map((src, index) => (
        <div key={index} className={`gallery-item gallery-item-${index + 1}`}>
